import React from 'react';
const myStore = (props) => {
  return (
    <div className="customer" style={{width:"30%",padding:"10%",display:"inline-block",backgroundImage:`src(${this.props.src})`,backgroundSize:"100%",backgroundRepeat:"no-repeat"}}>
      <a href={props.url} target="_blank">{props.name}</a>
    </div>
  )
}
export default myStore;
